B.a6U=new A.dp('The Corporation was founded by @Pete AKA Weyland in the early days of the game.\n                              \nThe goal of The Corporation is the play the role of the "evil" richest company that have control that extend to each corner of the galaxy.\nSimilar to the Weyland-Yutani corp in Alien, Cyberdyne in Terminator...\n                              \nBeyond this funny image that is more as a joke, our goal is to build a better tommorow while keeping a fun and structured experience of collaboration that spread troughout all the aspects of the game.\n                              \nOur organization is build over the influence system that act as the democracy system of the CORP.\n                              ',null,B.dO,null,B.A,null,null,null,null,null,null,null,null,null)
B.a6V=new A.dp("The structure of The Corporation is divided into Departments and Divisions.\n                              \nThe departments are the main branches that are based on general activities such as Ressources gathering, Exploration, Combat....\n                              \nDivisions are the sub-branches that are based on specific activities such as Mining, Esport, Scouting, Space Combat...\n                              \nYou can join as many divisions as you want, but you will have to specify the importance of each divisions in your profile.\n                              \nThose weights as we call it will be used for your progress as well as how the Corporation will asign ressources to each divisions.\n                              ",null,B.dO,null,B.A,null,null,null,null,null,null,null,null,null)
